import { Component } from '@angular/core';

@Component({
  selector: 'app-about',
  templateUrl: './about.component.html',
  styleUrls: ['./about.component.css']
})
export class AboutComponent {

}
<h3>À propos</h3>

<p>Bienvenue, voici notre projet de certification de la POEC Java proposée par M2iFormation.
Celle-ci a été créée dans le but de fournir une petite application de messagerie semblable à Slack,
permettant aux utilisateurs de créer de nouveaux canaux de communication et de s'envoyer des messages sur chacun d'entre eux.</p>

<h4>Présentation de l'équipe</h4>

<p>
    Coralie Dubreuil -
    Ebru Jolivet -
    Florian Marchive -
    Noellie Peuch -
</p>
